const Navbar = () => {
    return (
        <div className="navbar">
            <a href="/"><h1 className="beige">iconicque</h1></a>
            <nav>
                <a href="/html/">HTML</a> |
                <a href="/css/">CSS</a> |
                <a href="/js/">JavaScript</a> |
                <a href="/python/">Python</a>
            </nav>
        </div>
    );
}

export default Navbar;
